import React, { useState } from "react";
import { FaEnvelope, FaMapMarkerAlt, FaPhone, FaWhatsapp, FaInstagram } from "react-icons/fa";

const Contact = () => {
  const [formData, setFormData] = useState({
    name: "",
    title: "",
    description: "",
  });

  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setMessage("Your query has been submitted. We'll get back to you soon!");
    setFormData({ name: "", title: "", description: "" });
  };

  return (
    <section className="container mx-auto px-6 py-12">
      <h2 className="text-3xl font-bold text-center mb-8">Contact Us</h2>

      {/* Contact Details */}
      <div className="grid md:grid-cols-2 gap-8">
        <div className="space-y-4">
          <div className="flex items-center gap-4">
            <FaEnvelope className="text-xl text-blue-600" />
            <p className="text-lg font-medium">bikers@trailriders.in</p>
          </div>

          <div className="flex items-center gap-4">
            <FaMapMarkerAlt className="text-xl text-red-600" />
            <p className="text-lg font-medium">Brookfield, Bangalore 560037</p>
          </div>

          <div className="flex items-center gap-4">
            <FaPhone className="text-xl text-green-600" />
            <p className="text-lg font-medium">+91 7259770330</p>
          </div>

          <div className="flex items-center gap-4">
            <FaWhatsapp className="text-xl text-green-500" />
            <p className="text-lg font-medium">+91 7259770330</p>
          </div>

          <div className="flex items-center gap-4">
            <FaInstagram className="text-xl text-pink-500" />
            <p className="text-lg font-medium">@trailriders.in</p>
          </div>
        </div>

        {/* Query Form */}
        <div className="bg-gray-100 p-6 rounded-lg shadow-md">
          <h3 className="text-xl font-semibold mb-4">Send Us a Query</h3>

          <form onSubmit={handleSubmit} className="space-y-4">
            <div>
              <label className="block font-medium">Name</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                className="w-full border border-gray-300 rounded-lg p-2"
                required
              />
            </div>

            <div>
              <label className="block font-medium">Title</label>
              <input
                type="text"
                name="title"
                value={formData.title}
                onChange={handleChange}
                className="w-full border border-gray-300 rounded-lg p-2"
                required
              />
            </div>

            <div>
              <label className="block font-medium">Description</label>
              <textarea
                name="description"
                value={formData.description}
                onChange={handleChange}
                className="w-full border border-gray-300 rounded-lg p-2 h-28"
                required
              ></textarea>
            </div>

            <button
              type="submit"
              className="w-full bg-blue-600 text-white py-2 rounded-lg hover:bg-blue-700"
            >
              Submit
            </button>
          </form>

          {message && <p className="mt-4 text-green-600">{message}</p>}
        </div>
      </div>
    </section>
  );
};

export default Contact;
